import React, { useState, useEffect } from "react";
import TableList from "./TableList";
import { loadContributors } from "./../logic/contributorsActions";

function Dashboard() {
  const [contributors, setContributors] = useState();

  useEffect(() => {
    if (gameList.length === 0) loadGames().then(setGameList);
  }, [contributors]);
  return (
    <>
      <h1>Contributors List</h1>
      <input></input>
      <button
        onClick={(event) => {
          event.preventDefault();
          setContributors(loadContributors());
        }}
      >
        Get users!
      </button>
      <TableList contributors={contributors} />
    </>
  );
}

export default Dashboard;
